-- ----------------------------
-- Records of cookbook
-- ----------------------------
INSERT INTO `cookbook` VALUES (1, '黑松露炖鸡汤', '炖', '1、把土鸡宰杀、去毛、去内脏，斩成块状，放入沸水中焯去血水，捞起。2、把土鸡、黑松露、2片姜一起放入炖煮内，加入适量的清水，大火烧开。3、接着转小火继续慢炖2小时，最后起锅之前加入适量的淡盐即可关火食用。', 2);
INSERT INTO `cookbook` VALUES (2, '肺型侧耳炒鸡蛋', '炒', '将肺型侧耳洗净切片，鸡蛋打散加盐搅匀。锅中热油，下鸡蛋翻炒至凝固，盛出备用。锅中留少许油，下肺型侧耳和适量的水，加盐、鸡精、料酒等调味品，大火烧开后转小火煮至软嫩。最后将鸡蛋倒入锅中和肺型侧耳拌匀即可。', 1);

