INSERT INTO `info` VALUES (8, 1, 'data:image/jpeg;base64,', '绿树青山就是金山银山', '绿树青山就是金山银山，这是习近平总书记在2013年4月24日考察安徽省宣城市时首次提出的生态文明建设的重要理念。近年来，这一理念深入人心，引领着全国各地的绿色发展实践。\n\n以云浮市为例，这个位于广东省西南部的城市，正树牢绿水青山就是金山银山的理念，全力打造绿美广东生态建设的云浮样板。今年3月17日上午，云浮市组织开展2023年度绿美云浮生态建设义务植树示范活动，紧扣省委推动“绿美广东”生态建设的战略部署，纵深实施全民爱绿植绿护绿行动，不断厚植美丽云浮高质量发展的生态优势。\n\n据了解，云浮市坚持以习近平生态', '2023-03-20 23:24:00', 1);
INSERT INTO `info` VALUES (9, 1, 'data:image/jpeg;base64,', '争做巡林人，护佑晴朗天', '随着春季的到来，森林防火形势也日益严峻。为了提高公众的森林防火意识和能力，重庆市林业局联合当地社区、学校、企业等组织了一场主题为“争做巡林人，护佑晴朗天”的森林防火志愿者活动。\n\n活动当天，近百名志愿者分成若干小组，前往市郊的几个重点森林区域进行巡查。他们穿着统一的红色马甲，手持对讲机和灭火器材，沿着山路或小径行进，仔细观察周围的环境和隐患。他们及时清理路边的杂草、树叶等易燃物，拔除生长在树干上的寄生植物，检查野外用火设施和用电线路是否安全，发现并制止一些不文明行为，如乱扔烟头、烧烤、放鞭炮等。他们还向过', '2023-03-20 23:29:00', 1);
INSERT INTO `info` VALUES (10, 1, 'data:image/jpeg;base64,', '毒菇虽毒，切莫要‘踩’', '毒菇是自然界中的一种奇妙生物，它们有着各种各样的形状、颜色和气味，有些可以食用，有些则含有致命的毒素。然而，不管它们是美味还是危险，我们都应该尊重它们的生存权利，不要随意破坏它们的生态环境。在欣赏大自然之美时，也要注意保护生物多样性。对于那些长相奇特、身份神秘的毒菇来说，“切勿随意采摘”已经是常识了，“切勿随意踩”也应该成为常识。因为你所踩过的那株毒菇说不定就是世界上最后一株。', '2023-03-20 23:46:00', 1);
INSERT INTO `info` VALUES (11, 1, 'data:image/jpeg;base64,', '助农-种', '根据当地的气候和环境，选择适合的栽培季节和品种。一般来说，冬季是比较适宜种植蘑菇的季节。\n准备好合适的生长介质，如稻草、锯末、麦秸等，并进行消毒处理，以杀灭有害微生物。\n在生长介质中播撒蘑菇菌丝或者接种蘑菇培养袋，并保持适当的温度、湿度和通风条件。\n观察蘑菇的生长情况，及时摘除病虫害和杂草，并注意防止过度干燥或浸水。\n当蘑菇帽张开并露出褶皱时，就可以采摘了。采摘时要轻轻拧断蘑菇茎，并留下一部分茎基以利于再次出芽。', '2023-03-20 23:59:00', 1);
INSERT INTO `info` VALUES (12, 1, 'data:image/jpeg;base64,', '助农-销', '有几种方法可以助力农户销售蘑菇：\n\n线上销售平台：农户可以在电商平台、社交媒体等线上渠道上销售蘑菇，提高产品的曝光率和销售量。这需要农户具备一定的电商技能，也需要打造好品牌形象。\n\n农民专卖店：农户可以开设自己的专卖店，在城市中心区域或者场地租用比较便宜的地方出售蘑菇等农产品。这需要农户具备相关的经营管理技能，并且要有足够的人流量来支撑赢利。\n\n产地直供：农户可以通过参加各类农产品展销会或组织产地直供活动，与消费者面对面接触，提高销售额。这样的活动会增强产品的知名度和信誉度。\n\n向餐饮企业销售：农户可以主', '2023-03-21 00:05:00', 1);
INSERT INTO `info` VALUES (13, 1, 'data:image/jpeg;base64,', '助农-吃', '蘑菇：美食中的营养宝库\n在我们的日常生活中，美食总是让人无法抗拒，而在这美食的世界里，蘑菇则是一种特殊的存在。蘑菇不仅美味可口，而且具有丰富的营养价值，吸引着越来越多的人将其列入餐桌之上。对于种植蘑菇的农户来说，这是一个极具潜力的产业，也为广大消费者提供了一道道健康美味的佳肴。\n\n蘑菇的营养价值\n蘑菇作为一种低热量、低脂肪、高蛋白质的食物，具有很高的营养价值。其中含有丰富的蛋白质、维生素、矿物质和膳食纤维，对于维持人体健康具有非常重要的作用。以下是蘑菇的一些主要营养成分：\n\n蛋白质：蘑菇的蛋白质含量较高，', '2023-03-21 00:23:00', 1);
INSERT INTO `info` VALUES (14, 1, 'data:image/jpeg;base64,', '更新通知', '版本1.3.0，更新数据库内容，删除测试数据，加入蘑菇数据。', '2023-03-21 00:27:00', 0);

-- ----------------------------
-- Table structure for mushroom
-- ----------------------------
DROP TABLE IF EXISTS `mushroom`;
CREATE TABLE `mushroom`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '蘑菇名',
  `color` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '蘑菇颜色',
  `photo` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '蘑菇图片',
  `description` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '简介',
  `tags_id` int(11) NOT NULL COMMENT '标签id',
  `classify_id` int(11) NOT NULL COMMENT '分类id',
  `area_id` int(11) NOT NULL COMMENT '地区id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `tags_id`(`tags_id`) USING BTREE,
  INDEX `classify_id`(`classify_id`) USING BTREE,
  INDEX `area_id`(`area_id`) USING BTREE,
  CONSTRAINT `mushroom_ibfk_1` FOREIGN KEY (`tags_id`) REFERENCES `tags` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `mushroom_ibfk_2` FOREIGN KEY (`classify_id`) REFERENCES `classify` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `mushroom_ibfk_3` FOREIGN KEY (`area_id`) REFERENCES `areas` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 51 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

