-- Records of mushroom
-- ----------------------------
INSERT INTO `mushroom` VALUES (1, '肺形侧耳', '#ffffff', 'data:image/jpeg;base64,', '肺形侧耳（学名：Pleurotus pulmonarius (Fr.) Quél. ）是侧耳科、侧耳属真菌。子实体中等大。菌盖扁半球形至平展，倒卵形至肾形或近扇形，基部延长成柄，表面光滑，白色、灰白色至灰黄色，菌肉白色，靠近基部稍厚。菌褶白色，稍密，延生，褶缘平滑。菌柄白色有绒毛，孢子子印白色。孢子无色透明、光滑，近圆柱形菌盖外皮层菌丝略分化，近平伏。\r\n分布于中国西藏、广西、陕西、广东、新疆、河南等省、自治区。夏秋季生阔叶树倒木、枯树干或木桩上，一般丛生在一起。\r\n肺形侧耳质地细嫩，鲜甜爽口，营养丰富，', 4, 2, 1);
INSERT INTO `mushroom` VALUES (2, '黑松露', '#000000', 'data:image/jpeg;base64,', '黑松露（拉丁名为Tuber melanosporum ，英文称为perigord truffle），也称块菌，是一种生长于地下的野生食用真菌，外表崎岖不平。\n色泽介于深棕色与黑色之间，呈小凸起状，遍及灰色或者浅黑色与白色的纹理，其气味特殊，难以形容，有人形容像蕈菇/蒜头。就所知主要分布于阿尔卑斯山脉及喜马拉雅山脉的少数地区，以及四川省攀枝花市盐边县周边的攀西地区，占据中国黑松露总产量的60%。', 4, 4, 3);
INSERT INTO `mushroom` VALUES (3, '毒蝇鹅膏菌', '#ff4500', 'data:image/jpeg;base64,', '称哈蟆菌、捕蝇菌、毒蝇菌、毒蝇伞。 子实体较大。菌盖宽6-20cm。边缘有明显的短条棱，表面鲜红色或桔红色，并有白色或稍带黄色的颗粒状鳞片。菌褶纯白色，密，离生，不等长。菌肉白色，靠近盖表皮处红色。', 3, 1, 1);
INSERT INTO `mushroom` VALUES (4, '金针菇', '#DACDAF', 'data:image/jpeg;base64,', '金针菇，口蘑科金针菇属菌类。其菌盖球形，边缘薄，黄褐色，表面黏滑，基部相连，呈族生状。干品形似金针菜，故名金针菇。 [9]  金针菇表面为黄色、深黄褐色或肉桂色，中部色稍深，边缘乳黄色。金针菇丝白色至乳白色或微带肉粉色，长度不等。在中国、日本、俄罗斯、欧洲、北美洲澳大利亚等地均有分布。', 4, 5, 5);
INSERT INTO `mushroom` VALUES (5, '鸡腿菇', '#AAA18D', 'data:image/jpeg;base64,', '鸡腿菇，学名是毛头鬼伞，因其形如鸡腿，肉质似鸡丝而得名，并无鸡肉味，是近年来人工开发的具有商业潜力的珍稀菌品，被誉为“菌中新秀”。鸡腿菇营养丰富、味道鲜美，口感极好，具有很高的营养价值。', 4, 1, 5);
INSERT INTO `mushroom` VALUES (6, '鸡枞菌', '#B18F72', 'data:image/jpeg;base64,', '鸡枞菌，在自然界是和白蚁共生的菌类，白蚁构筑蚁巢的同时培养了鸡㙡菌菌丝体，形成一个共同的生态系统，这种菌本来是在我国云南贵州等南方省市的森林中才有。', 4, 1, 4);

