-- ----------------------------
-- View structure for mushroomInfo
-- ----------------------------
DROP VIEW IF EXISTS `mushroomInfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `mushroomInfo` AS select `mushroom`.`id` AS `id`,`mushroom`.`name` AS `mushroomName`,`mushroom`.`color` AS `color`,`mushroom`.`photo` AS `photo`,`mushroom`.`description` AS `description`,`areas`.`name` AS `area`,`classify`.`name` AS `classify`,`tags`.`name` AS `tag` from (((`mushroom` join `areas` on((`mushroom`.`area_id` = `areas`.`id`))) join `classify` on((`mushroom`.`classify_id` = `classify`.`id`))) join `tags` on((`mushroom`.`tags_id` = `tags`.`id`)));

SET FOREIGN_KEY_CHECKS = 1;
